import React, { Component } from "react";
import { Statistic, Header } from "semantic-ui-react";
import { connect } from 'react-redux'

const UserAnalytics = () => {

  return (
    <>
    <Header>Your Reviews</Header>
    <Statistic.Group >
      <Statistic color='red'>
        <Statistic.Value>27</Statistic.Value>
        <Statistic.Label>red</Statistic.Label>
      </Statistic>

    </Statistic.Group>
    </>
  );
}

const mapStateToProps = state => {
  return {
    reviews: state.Review
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(UserAnalytics);
